*/
/*
next : json Server資料 放在表單
*/ 
const List = ()=>{
    const [data,setData] = useState([]);
    fetch('http://localhost:3000/posts/1')
    .then(res => res.json())
    .then(data =>{
        console.log(data.id);
    })

    return <div className="list">
            <select name="datas" size="2" multiple>
                <option value="1" onClick={refresh}>文字1</option>
                <option value="2">文字2</option>
            </select>
    </div>     
}

export default List;
